product.ingredients_text:
Farine de blé 58 % ; sucre ; huile de colza ; flocons de soja 7 % ; germe de blé 5 % ; jus d'orange concentré 1,8 % (soit 9 % en équivalent fruit) ; amidon de maïs ; maltodextrine ; 
poudres à lever : E500, E450 ; arôme naturel ; fèves de soja décortiquées ; émulsifiant : lécithines (tournesol) ; sel ; minéraux : magnésium, fer ; vitamines : B1, B3, B6, B9, E ; enzyme (contient blé). 
Traces de fruits à coque, graines de sésame, œufs et lait.

